import React from "react";
import { Link } from "react-router-dom";

import {
  UncontrolledCollapse,
  DropdownMenu,
  DropdownItem,
  UncontrolledDropdown,
  NavbarBrand,
  Navbar,
  NavItem,
  NavLink,
  Nav,
  Container,
  Row,
  Col,
} from "reactstrap";

const NavBar = (props) => {
  return (
    <>
      <Navbar expand="lg" className="navbar-horizontal navbar-dark bg-default" >
        <Container>
          <NavbarBrand href="#pablo" onClick={e => e.preventDefault()}>
            Default Color
          </NavbarBrand>

        </Container>
      </Navbar>
    </>
  );
}

export default NavBar;
